using Microsoft.AspNetCore.Mvc;
using Microsoft.EntityFrameworkCore;
using Microsoft.Extensions.Caching.Memory;
using MisMinistritosAPI.Data;
using MisMinistritosAPI.Models;
using MisMinistritosAPI.Models.Combo;
using MisMinistritosAPI.Models.ModelDb;
using System.Net;

// For more information on enabling Web API for empty projects, visit https://go.microsoft.com/fwlink/?LinkID=397860

namespace MisMinistritosAPI.Controllers
{

    [Route("ConectarApi/[controller]")]
    [ApiController]
    public class ClienteController : ControllerBase
    {
        private readonly ContextDb _contextDb;

        public ClienteController(ContextDb contextDb) //Constructor para el controller.
        {
            _contextDb = contextDb;
        }

        [HttpGet]
        public async Task<List<ClienteModel>> GetListaCompleta() //Retorna toda la lista 
        {
            try
            {
                var cliente = await (from t in _contextDb.ClienteDbModel
                                     select new ClienteModel
                                     {
                                         cedula = t.cedula,
                                         nombreCompleto = t.nombreCompleto,
                                         fechaNacimiento = t.fechaNacimiento,
                                         telefono = t.telefono,
                                         profesion = t.profesion,
                                         correoElectronico = t.correoElectronico,
                                         comboReferencia = t.comboReferencia,
                                         contrasena = t.contrasena,
                                     }
                    ).ToListAsync();

                return cliente;
            }
            catch
            {
                return null;
            }
        }


        [HttpGet("{cedula}")]
        public async Task<ActionResult<ClienteDbModel>> GetUnCliente(string cedula) //Retorna un cliente de la lista
        {
            try
            {
                var cliente = _contextDb.ClienteDbModel.FirstOrDefault(c => c.cedula == cedula);

                if ( cliente == null && cedula == "1-1111-1111")
                {
                    ClienteDbModel administrador = new ClienteDbModel();
                    administrador.cedula = cedula;
                    administrador.contrasena = "123";
                    administrador.nombreCompleto = "Administrador";
                    administrador.profesion = "No aplica información";
                    administrador.comboReferencia = "No aplica información";
                    administrador.telefono = "0000-0000";
                    administrador.fechaNacimiento = 0;
                    administrador.correoElectronico = "No aplica información";

                    _contextDb.ClienteDbModel.Add(administrador);
                    await _contextDb.SaveChangesAsync();

                    if ((_contextDb.ClienteDbModel.Any(c => c.cedula == "09-9999-9999")) == false)
                    {
                        ClienteDbModel cliente2 = new ClienteDbModel();
                        cliente2.cedula = "09-9999-9999";
                        cliente2.contrasena = "qweqwe123$";
                        cliente2.nombreCompleto = "Lucia Rojas";
                        cliente2.profesion = "Arquitecta provincial";
                        cliente2.comboReferencia = "Por Redes Sociales";
                        cliente2.telefono = "5555-5555";
                        cliente2.fechaNacimiento = 2000;
                        cliente2.correoElectronico = "lucia@ddd.com";

                        _contextDb.ClienteDbModel.Add(cliente2);
                        await _contextDb.SaveChangesAsync();
                    }

                    ProductoDbModel productoDbModel = new ProductoDbModel();
                    productoDbModel.id = "PPP111";
                    productoDbModel.descripcion = "Llaveros de Animales";
                    productoDbModel.ingreso = 2000;
                    productoDbModel.proveedor = "05-5555-5555";
                    productoDbModel.precioCompra = 5000;
                    productoDbModel.utilidad = 30;
                    _contextDb.ProductoDbModel.Add(productoDbModel);
                    await _contextDb.SaveChangesAsync();

                    TourDbModel tourDbModel = new TourDbModel();
                    tourDbModel.id = "TTT111";
                    tourDbModel.descripcion = "Tour a la Isla Tortuga";
                    tourDbModel.verImagen = "";
                    tourDbModel.diasTour = "Solo Domingo";
                    tourDbModel.proveedor = "02-2222-2222";
                    tourDbModel.precioTour = 45000;
                    _contextDb.TourDbModel.Add(tourDbModel);
                    await _contextDb.SaveChangesAsync();



                    return administrador;
                }   
                
                return cliente;
            }
            catch
            {
                return null;
            }
        }

        // POST api/<ClienteController>
        [HttpPost]
        public async Task<IActionResult> PostAsync([FromBody] ClienteDbModel cliente) //Añadir un cliente
        {
            try
            {
                if ( (_contextDb.ClienteDbModel.Any(c => c.cedula == cliente.cedula)) == true ) return BadRequest("El cliente ya existe");                
                
                _contextDb.ClienteDbModel.Add(cliente);
                await _contextDb.SaveChangesAsync();

                return Ok(cliente);
            }
            catch
            {
                return null;
            }
        }


        //PUT api/<ClienteController>/5
        [HttpPut]
        public async Task PutAsync([FromBody] ClienteDbModel cliente)
        {
            try
            {
                var clienteDb = await (from t in _contextDb.ClienteDbModel where t.cedula == cliente.cedula select t).FirstOrDefaultAsync();

                clienteDb.cedula = cliente.cedula;
                clienteDb.nombreCompleto = cliente.nombreCompleto;
                clienteDb.telefono = cliente.telefono;
                clienteDb.profesion = cliente.profesion;
                clienteDb.correoElectronico = cliente.correoElectronico;
                clienteDb.comboReferencia = cliente.comboReferencia;
                clienteDb.contrasena = cliente.contrasena;

                await _contextDb.SaveChangesAsync();

            }
            catch (Exception)
            {

                throw;
            }
            
        }

        // DELETE api/<ClienteController>/5
        [HttpDelete("{cedula}")]
        public async Task DeleteAsync(string cedula)
        {
            try
            {
                var clienteDb = await(from t in _contextDb.ClienteDbModel where t.cedula == cedula select t).FirstOrDefaultAsync();
                _contextDb.ClienteDbModel.Remove(clienteDb);
                await _contextDb.SaveChangesAsync();
            }
            catch
            {

            }
        }
    }
}
